import React from 'react'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import Main from './AppFlow/MainScreen/Main'
import LoginIn from './AuthFlow/LoginIn/LoginIn'
import ForgotPassword from './AuthFlow/ForgotPassword/ForgotPassword'
import Otp from './AuthFlow/OTP/Otp' 
import SignIn from './AuthFlow/SignIn/SignIn'

const AuthStack = () => {
    return(
        <Routes>
            <Route path='/app/Signin' element={<SignIn/>}/>
            <Route path='/app/LoginIn' element={<LoginIn/>}/>
            <Route path='app/OTP' element={<Otp/>}/>
            <Route path='app/ForgotPassword' element={<ForgotPassword/>}/>
        </Routes>
        
    )
}

const AppStack = () => {
    return(
        <Routes>
            <Route path='*' element={<Main/>}/>
        </Routes>
    )
}


export default function App() {
    const IsAuthenticated = true
    return (
            <Router>
                {
                    IsAuthenticated ? (
                        <AppStack/>
                    ) :
                    <AuthStack/>
                }
            </Router>
    )
}
